import styled from 'styled-components';
const Category = ({ categoryList }) => {
  //   const categoryComponentList = categoryList.map((el) => {
  //     <CategoryContent>{el.name}</CategoryContent>;
  //   });
  //   console.log(categoryComponentList);
  return (
    <CategoryBox>
      {categoryList.map((el) => (
        <CategoryContent key={el.name}>{el.name}</CategoryContent>
      ))}
    </CategoryBox>
  );
};
export default Category;

const CategoryContent = styled.div`
  margin: 5px;
  padding: 5px;
  border-radius: 3px;
  background-color: rgba(10, 10, 35, 0.8);
`;
const CategoryBox = styled.div`
  display: flex;
`;
